import React from 'react';
import classes from '../postinfo/postinfo.module.css';

export default (props) => {
    return(
        <div className={classes.post}> 
        <div>
            <span> {props.author}</span>
            <b> {props.date}</b>
        </div>
        <div>
            <h2>{props.title}</h2>
            <p>{props.disc}</p>
        </div>
    </div> 
    );
}
